    @Test
    public void test1() {
        OperatorFactoryLocal engine = OperatorFactoryLocal.getInstance();
        OperatorGeneralize op = (OperatorGeneralize) engine.getOperator(Operator.Type.Generalize);

        Polygon poly = new Polygon();
        poly.startPath(0, 0);
        poly.lineTo(1, 1);
        poly.lineTo(2, 0);
        poly.lineTo(3, 2);
        poly.lineTo(4, 1);
        poly.lineTo(5, 0);
        poly.lineTo(5, 10);
        poly.lineTo(0, 10);
        Geometry geom = op.execute(poly, 2, true, null);
        Polygon p = (Polygon) geom;
        Point2D[] points = p.getCoordinates2D();
        assertTrue(points.length == 4);
        assertTrue(points[0].x == 0 && points[0].y == 0);
        assertTrue(points[1].x == 5 && points[1].y == 0);
        assertTrue(points[2].x == 5 && points[2].y == 10);
        assertTrue(points[3].x == 0 && points[3].y == 10);

        Geometry geom1 = op.execute(geom, 5, false, null);
        p = (Polygon) geom1;
        points = p.getCoordinates2D();
        assertTrue(points.length == 3);
        assertTrue(points[0].x == 0 && points[0].y == 0);
        assertTrue(points[1].x == 5 && points[1].y == 10);
        assertTrue(points[2].x == 5 && points[2].y == 10);

        geom1 = op.execute(geom, 5, true, null);
        p = (Polygon) geom1;
        points = p.getCoordinates2D();
        assertTrue(points.length == 0);
    }

    @Test
    public void test2() {
        OperatorFactoryLocal engine = OperatorFactoryLocal.getInstance();
        OperatorGeneralize op = (OperatorGeneralize) engine.getOperator(Operator.Type.Generalize);

        Polyline polyline = new Polyline();
        polyline.startPath(0, 0);
        polyline.lineTo(1, 1);
        polyline.lineTo(2, 0);
        polyline.lineTo(3, 2);
        polyline.lineTo(4, 1);
        polyline.lineTo(5, 0);
        polyline.lineTo(5, 10);
        polyline.lineTo(0, 10);
        Geometry geom = op.execute(polyline, 2, true, null);
        Polyline p = (Polyline) geom;
        Point2D[] points = p.getCoordinates2D();
        assertTrue(points.length == 4);
        assertTrue(points[0].x == 0 && points[0].y == 0);
        assertTrue(points[1].x == 5 && points[1].y == 0);
        assertTrue(points[2].x == 5 && points[2].y == 10);
        assertTrue(points[3].x == 0 && points[3].y == 10);

        Geometry geom1 = op.execute(geom, 5, false, null);
        p = (Polyline) geom1;
        points = p.getCoordinates2D();
        assertTrue(points.length == 2);
        assertTrue(points[0].x == 0 && points[0].y == 0);
        assertTrue(points[1].x == 0 && points[1].y == 10);

        geom1 = op.execute(geom, 5, true, null);
        p = (Polyline) geom1;
        points = p.getCoordinates2D();
        assertTrue(points.length == 2);
        assertTrue(points[0].x == 0 && points[0].y == 0);
        assertTrue(points[1].x == 0 && points[1].y == 10);
    }

    @Test
    public void testLargeDeviation() {
        {
            Polygon input_polygon = new Polygon();
            input_polygon
                    .addEnvelope(Envelope2D.construct(0, 0, 20, 10), false);
            Geometry densified_geom = OperatorDensifyByLength.local().execute(
                    input_polygon, 1, null);

            Geometry geom = OperatorGeneralize.local().execute(
                    densified_geom,
                    1,
                    true,
                    null);

            int pc = ((MultiPath) geom).getPointCount();
            assertTrue(pc == 4);

            Geometry large_dev1 = OperatorGeneralize.local().execute(
                    densified_geom,
                    40,
                    true,
                    null);

            int pc1 = ((MultiPath) large_dev1).getPointCount();
            assertTrue(pc1 == 0);

            Geometry large_dev2 = OperatorGeneralize.local().execute(
                    densified_geom, 40, false, null);
            int pc2 = ((MultiPath) large_dev2).getPointCount();
            assertTrue(pc2 == 3);
        }
    }

    @Test
    public void test1Area() {
        OperatorFactoryLocalEx engine = OperatorFactoryLocalEx.getInstance();
        OperatorGeneralizeByArea op = (OperatorGeneralizeByArea) engine.getOperator(OperatorEx.Type.GeneralizeByArea);

        assertNotNull(op);

        Polygon poly = new Polygon();
        poly.startPath(0, 0);
        poly.lineTo(1, 1);
        poly.lineTo(2, 0);
        poly.lineTo(3, 2);
        poly.lineTo(4, 1);
        poly.lineTo(5, 0);
        poly.lineTo(5, 10);
        poly.lineTo(0, 10);
        poly = (Polygon) GeometryEngine.simplify(poly, SpatialReferenceEx.create(4326).toSpatialReference());
        String words2 = GeometryEngine.geometryToWkt(poly, 0);
        Geometry geom = op.execute(poly, 50.0, true, GeneralizeType.Neither, SpatialReferenceEx.create(4326), null);
        String words = GeometryEngine.geometryToWkt(geom, 0);
        assertNotNull(geom);
        Polygon p = (Polygon) geom;
        Point2D[] points = p.getCoordinates2D();
        assertTrue(points.length == 4);
        assertTrue(points[0].x == 0 && points[0].y == 0);
        assertTrue(points[1].x == 0 && points[1].y == 10);
        assertTrue(points[2].x == 5 && points[2].y == 10);
        assertTrue(points[3].x == 5 && points[3].y == 0);

        OperatorContains operatorContains = (OperatorContains) OperatorFactoryLocal.getInstance().getOperator(Operator.Type.Contains);

        Geometry geomContainer = op.execute(poly, 35, true, GeneralizeType.ResultContainsOriginal, SpatialReferenceEx.create(4326),null);
        words = GeometryEngine.geometryToWkt(geomContainer, 0);
        assertTrue(operatorContains.execute(geomContainer, poly, null, null));

        Geometry geomContained = op.execute(poly, 30, true, GeneralizeType.ResultWithinOriginal, SpatialReferenceEx.create(4326),null);
        assertTrue(operatorContains.execute(poly, geomContained, null, null));
    }

