    @Test
    public void testCompleteRemoval() {

        OperatorFactoryLocalEx engine = OperatorFactoryLocalEx.getInstance();
        OperatorGeneralizeByArea op = (OperatorGeneralizeByArea) engine.getOperator(OperatorEx.Type.GeneralizeByArea);

        assertNotNull(op);

        Polygon poly = new Polygon();
        poly.startPath(0, 0);
        poly.lineTo(1, 1);
        poly.lineTo(2, 0);
        poly.lineTo(3, 2);
        poly.lineTo(4, 1);
        poly.lineTo(5, 0);
        poly.lineTo(5, 10);
        poly.lineTo(0, 10);
        Geometry geom = op.execute(poly, 100.0, true, GeneralizeType.Neither, SpatialReferenceEx.create(4326),null);
        assertTrue(geom.isEmpty());
    }


